import CardLivros from '../CardLivros'


const MainContainer = styled.main`
  display: flex;
  margin: 4% 15%;
  justify-content: center;
`

const Titulo = styled.h1`
  display: flex;
  margin: 4% 15%;
  justify-content: center;
`

function Main() {
    return (
      <MainContainer>
        <>Confira nossas promoções:</>
        <CardLivros/>
      </MainContainer>
    )
}

export default Main
